//www.opengis.net/def/crs/OGC/1.3/CRS84"],"default":"http://www.opengis.net/def/crs/OGC/1.3/CRS84"}}},"temporal":{"description":"The temporal extent of the features in the collection.","type":"object","properties":{"interval":{"description":"One or more time intervals that describe the temporal extent of the dataset.\\nThe value `null` is supported and indicates an unbounded interval end.\\nIn the Core only a single time interval is supported. Extensions may support\\nmultiple intervals. If multiple intervals are provided, the union of the\\nintervals describes the temporal extent.","type":"array","minItems":1,"items":{"description":"Begin and end times of the time interval. The timestamps are in the\\ntemporal coordinate reference system specified in `trs`. By default\\nthis is the Gregorian calendar.","type":"array","minItems":2,"maxItems":2,"items":{"type":"string","format":"date-time","nullable":true}}},"trs":{"description":"Coordinate reference system of the coordinates in the temporal extent\\n(property `interval`). The default reference system is the Gregorian calendar.\\nIn the Core this is the only supported temporal coordinate reference system.\\nExtensions may support additional temporal coordinate reference systems and add\\nadditional enum values.","type":"string","enum":["http://www.opengis.net/def/uom/ISO-8601/0/Gregorian"],"default":"http://www.opengis.net/def/uom/ISO-8601/0/Gregorian"}}}}},"featureCollectionGeoJSON":{"type":"object","required":["type","features"],"properties":{"type":{"type":"string","enum":["FeatureCollection"]},"features":{"type":"array","items":{"$ref":"#/components/schemas/featureGeoJSON"}},"links":{"type":"array","items":{"$ref":"#/components/schemas/link"}},"timeStamp":{"$ref":"#/components/schemas/timeStamp"},"numberMatched":{"$ref":"#/components/schemas/numberMatched"},"numberReturned":{"$ref":"#/components/schemas/numberReturned"}}},"featureGeoJSON":{"type":"object","required":["type","geometry","properties"],"properties":{"id":{"oneOf":[{"type":"string"},{"type":"integer"}]},"type":{"type":"string","enum":["Feature"]},"geometry":{"$ref":"#/components/schemas/geometryGeoJSON"},"properties":{"type":"object","nullable":true},"links":{"type":"array","items":{"$ref":"#/components/schemas/link"}}}},"geometryGeoJSON":{"oneOf":[{"$ref":"#/components/schemas/pointGeoJSON"},{"$ref":"#/components/schemas/multipointGeoJSON"},{"$ref":"#/components/schemas/linestringGeoJSON"},{"$ref":"#/components/schemas/multilinestringGeoJSON"},{"$ref":"#/components/schemas/polygonGeoJSON"},{"$ref":"#/components/schemas/multipolygonGeoJSON"},{"$ref":"#/components/schemas/geometrycollectionGeoJSON"}],"nullable":true},"geometrycollectionGeoJSON":{"type":"object","required":["type","geometries"],"properties":{"type":{"type":"string","enum":["GeometryCollection"]},"geometries":{"type":"array","items":{"$ref":"#/components/schemas/geometryGeoJSON"}}}},"landingPage":{"type":"object","required":["links"],"properties":{"title":{"type":"string"},"description":{"type":"string"},"links":{"type":"array","items":{"$ref":"#/components/schemas/link"}}}},"linestringGeoJSON":{"type":"object","required":["type","coordinates"],"properties":{"type":{"type":"string","enum":["LineString"]},"coordinates":{"type":"array","minItems":2,"items":{"type":"array","minItems":2,"items":{"type":"number"}}}}},"link":{"type":"object","required":["href","rel"],"properties":{"href":{"type":"string"},"rel":{"type":"string"},"type":{"type":"string"},"hreflang":{"type":"string"},"title":{"type":"string"},"length":{"type":"integer"}}},"linkTemplate":{"type":"object","required":["uriTemplate","rel"],"properties":{"uriTemplate":{"type":"string"},"rel":{"type":"string"},"title":{"type":"string"},"type":{"type":"string"},"varBase":{"type":"string","format":"uri-reference"}}},"multilinestringGeoJSON":{"type":"object","required":["type","coordinates"],"properties":{"type":{"type":"string","enum":["MultiLineString"]},"coordinates":{"type":"array","items":{"type":"array","minItems":2,"items":{"type":"array","minItems":2,"items":{"type":"number"}}}}}},"multipointGeoJSON":{"type":"object","required":["type","coordinates"],"properties":{"type":{"type":"string","enum":["MultiPoint"]},"coordinates":{"type":"array","items":{"type":"array","minItems":2,"items":{"type":"number"}}}}},"multipolygonGeoJSON":{"type":"object","required":["type","coordinates"],"properties":{"type":{"type":"string","enum":["MultiPolygon"]},"coordinates":{"type":"array","items":{"type":"array","items":{"type":"array","minItems":4,"items":{"type":"array","minItems":2,"items":{"type":"number"}}}}}}},"numberMatched":{"description":"The number of features of the feature type that match the selection\\nparameters like `bbox`.","type":"integer","minimum":0},"numberReturned":{"description":"The number of features in the feature collection.\\n\\nA server may omit this information in a response, if the information\\nabout the number of features is not known or difficult to compute.\\n\\nIf the value is provided, the value shall be identical to the number\\nof items in the \\"features\\" array.","type":"integer","minimum":0},"pointGeoJSON":{"type":"object","required":["type","coordinates"],"properties":{"type":{"type":"string","enum":["Point"]},"coordinates":{"type":"array","minItems":2,"items":{"type":"number"}}}},"polygonGeoJSON":{"type":"object","required":["type","coordinates"],"properties":{"type":{"type":"string","enum":["Polygon"]},"coordinates":{"type":"array","items":{"type":"array","minItems":4,"items":{"type":"array","minItems":2,"items":{"type":"number"}}}}}},"timeStamp":{"description":"This property indicates the time and date when the response was generated.","type":"string","format":"date-time"}},"responses":{"LandingPage":{"description":"The landing page provides links to the API definition\\n(link relations `service-desc` and `service-doc`),\\nthe Conformance declaration (path `/conformance`,\\nlink relation `conformance`), and the Feature\\nCollections (path `/collections`, link relation\\n`data`).","content":{"application/json":{"schema":{"$ref":"#/components/schemas/landingPage"}},"text/html":{"schema":{"type":"string"}}}},"ConformanceDeclaration":{"description":"The URIs of all conformance classes supported by the server.\\n\\nTo support \\"generic\\" clients that want to access multiple\\nOGC API Features implementations - and not \\"just\\" a specific\\nAPI / server, the server declares the conformance\\nclasses it implements and conforms to.","content":{"application/json":{"schema":{"$ref":"#/components/schemas/confClasses"}},"text/html":{"schema":{"type":"string"}}}},"Collections":{"description":"The feature collections shared by this API.\\n\\nThe dataset is organized as one or more feature collections. This resource\\nprovides information about and access to the collections.\\n\\nThe response contains the list of collections. For each collection, a link\\nto the items in the collection (path `/collections/{collectionId}/items`,\\nlink relation `items`) as well as key information about the collection.\\nThis information includes:\\n\\n* A local identifier for the collection that is unique for the dataset;\\n* An optional list of coordinate reference systems (CRS) in which geometries may be returned by the server. The default value is a list with the default CRS (WGS 84 with axis order longitude/latitude).\\n* An optional title and description for the collection;\\n* An optional extent that can be used to provide an indication of the spatial and temporal extent of the collection - typically derived from the data;\\n* An optional indicator about the type of the items in the collection (the default value, if the indicator is not provided, is \'feature\').","content":{"application/json":{"schema":{"$ref":"#/components/schemas/collections"}},"text/html":{"schema":{"type":"string"}}}},"Collection":{"description":"Information about the feature collection with id `collectionId`.\\n\\nThe response contains a link to the items in the collection\\n(path `/collections/{collectionId}/items`, link relation `items`)\\nas well as key information about the collection. This information\\nincludes:\\n\\n* A local identifier for the collection that is unique for the dataset;\\n* An optional list of coordinate reference systems (CRS) in which geometries may be returned by the server. The default value is a list with the default CRS (WGS 84 with axis order longitude/latitude).\\n* An optional title and description for the collection;\\n* An optional extent that can be used to provide an indication of the spatial and temporal extent of the collection - typically derived from the data;\\n* An optional indicator about the type of the items in the collection (the default value, if the indicator is not provided, is \'feature\').","content":{"application/json":{"schema":{"$ref":"#/components/schemas/featureCollection"}},"text/html":{"schema":{"type":"string"}}}},"Features":{"description":"The response is a document consisting of features in the collection.\\nThe features included in the response are determined by the server\\nbased on the query parameters of the request. To support access to\\nlarger collections without overloading the client, the API supports\\npaged access with links to the next page, if more features are selected\\nthat the page size.\\n\\nThe `bbox` and `datetime` parameter can be used to select only a\\nsubset of the features in the collection (the features that are in the\\nbounding box or time interval). The `bbox` parameter matches all features\\nin the collection that are not associated with a location, too. The\\n`datetime` parameter matches all features in the collection that are\\nnot associated with a time stamp or interval, too.\\n\\nThe `limit` parameter may be used to control the subset of the\\nselected features that should be returned in the response, the page size.\\nEach page may include information about the number of selected and\\nreturned features (`numberMatched` and `numberReturned`) as well as\\nlinks to support paging (link relation `next`).","content":{"application/geo+json":{"schema":{"$ref":"#/components/schemas/featureCollectionGeoJSON"}},"text/html":{"schema":{"type":"string"}}},"headers":{"Content-Crs":{"$ref":"#/components/headers/Content-Crs"}}},"Feature":{"description":"fetch the feature with id `featureId` in the feature collection\\nwith id `collectionId`","content":{"application/geo+json":{"schema":{"$ref":"#/components/schemas/featureGeoJSON"}},"text/html":{"schema":{"type":"string"}}},"headers":{"Content-Crs":{"$ref":"#/components/headers/Content-Crs"}}},"InvalidParameter":{"description":"A query parameter has an invalid value.","content":{"application/json":{"schema":{"$ref":"#/components/schemas/exception"}},"text/html":{"schema":{"type":"string"}}}},"NotFound":{"description":"The requested resource does not exist on the server. For example, a path parameter had an incorrect value."},"NotAcceptable":{"description":"Content negotiation failed. For example, the `Accept` header submitted in the request did not support any of the media types supported by the server for the requested resource."},"ServerError":{"description":"A server error occurred.","content":{"application/json":{"schema":{"$ref":"#/components/schemas/exception"}},"text/html":{"schema":{"type":"string"}}}}},"headers":{"Content-Crs":{"description":"a URI, in angular brackets, identifying the coordinate reference system used in the content / payload","schema":{"type":"string"}}}}'),GCe={openapi:UCe,info:zCe,servers:BCe,paths:HCe,components:VCe},WCe="3.0.2",KCe={title:"A sample API conforming to the standard OGC API - Processes - Part 1",version:"1.0.0",contact:{name:"Acme Corporation",email:"info@example.org",url:"http://example.org/"},license:{name:"CC-BY 4.0 license",url:"https://creativecommons.org/licenses/by/4.0/"}},YCe=[{url:"https://data.example.org/",description:"Production server"},{url:"https://dev.example.org/",desc